__NUXT_JSONP__("/gallery/mission-impossible", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"Mission: Impossible",spans:[]}],photo:{dimensions:{width:1000,height:800},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002F7398a6f5-562f-4efe-a402-a11c47c49915_Mission+Impossible.jpg?auto=compress,format&rect=0,0,1600,1280&w=1000&h=800",small:{dimensions:{width:320,height:256},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002F7398a6f5-562f-4efe-a402-a11c47c49915_Mission+Impossible.jpg?auto=compress,format&rect=0,0,1600,1280&w=320&h=256"}},content:[{type:b,text:"The mission: take a family picture of mum & dad with both  kids wearing their new mint green striped shirts with everyone looking  at the camera and looking happy at the same time. Well that was never  gonna happen. When the little guy wasn't falling asleep in his mommy's  arms, the other guy was being totally uncooperative and refusing to look  at the camera and dad was looking like he hadn't slept for days… which  was partially true cause between never ending feeds and nappy changes  and bathings and baptism preparations and generally everybody going  nutz, life has been kinda hectic chez Gallucci these days.",spans:[]},{type:b,text:"So I  took the easy way out and Photoshopped the kids' heads with ones I'd  taken on the rare occasions when things were calm… and I also exchanged  the suitcases under Art's eyes for a pair of light handbags.\nNow everybody looks happy. And at the camera.",spans:[]},{type:b,text:"Piece of cake",spans:[]},{type:b,text:"EOS 5D MkIII + EF 24-105L IS",spans:[]}],tag:"portrait"}}],fetch:[],mutations:void 0}}(null,"paragraph")));